import React from 'react';
import styled from 'styled-components';
import activeLikeSrc from '../../images/like-active.svg';
import disabledLikeSrc from '../../images/like-disabled.svg';

const AriclesWrapper = styled.div`

`;

const ArticlesItem = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr;
`;

const ArticlesInfo = styled.div`
  display: grid;
  grid-column: span 3;
  grid-template-rows: auto auto 1fr;
  align-content: start;
`;

const ArticlesHeader = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`;

const ArticlesTitle = styled.span`
  color: #1890FF;
  font-size: 20px;
`;

const ArticlesStats = styled.div`

`;

const ArtickesLikeImg = styled.img`
  width: 16px;
  height: 16px;
`;


const ArticlesLikesCount = styled.span``;

const ArticlesUserInfo = styled.div`
  display: grid;
  grid-column: 4 / 5;
`;

const ArticlesTagsWrap = styled.div`

`;

const ArticlesTag = styled.span``;

const ArticlesDescription = styled.p``;

const ArticlesUserInfoGroup = styled.div``;

const ArticlesUsername = styled.p``;

const ArticlesDate = styled.p``;

const ArticlesUserImage = styled.img``;

const ArticlesList = () => {

  return (
    <AriclesWrapper>
      <ArticlesItem>
        <ArticlesInfo>
          <ArticlesHeader>
            <ArticlesTitle>
              Some article title
            </ArticlesTitle>
            <ArticlesStats>
              <ArtickesLikeImg src={disabledLikeSrc}/>
              <ArticlesLikesCount>10</ArticlesLikesCount>
            </ArticlesStats>
          </ArticlesHeader>
          <ArticlesTagsWrap>
            <ArticlesTag>tag</ArticlesTag>
            <ArticlesTag>someTag</ArticlesTag>
          </ArticlesTagsWrap>

          <ArticlesDescription>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.
            Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat
          </ArticlesDescription>
        </ArticlesInfo>

        <ArticlesUserInfo>
          <ArticlesUserInfoGroup>
            <ArticlesUsername></ArticlesUsername>
            <ArticlesDate></ArticlesDate>
          </ArticlesUserInfoGroup>
          <ArticlesUserImage></ArticlesUserImage>
        </ArticlesUserInfo>
      </ArticlesItem>
    </AriclesWrapper>
  )
}

export default ArticlesList;
